import React, { useState } from "react";

const Nav = () => {
  const [isNavOpen, setIsNavOpen] = useState();

  const navToggle = {};
  const navLinks = [
    { text: "首頁", link: "/" },
    { text: "頁1", link: "/" },
    { text: "頁2", link: "/" },
    { text: "頁3", link: "/" },
    { text: "頁4", link: "/" },
  ];

  return (
    <nav>
      <section className="Logo">
        <img src="/images/thai-learn-logo.png" alt="Logo" />
        <h1>PaSaThai GO</h1>
      </section>
      <section className="menu">
        <ul>
          {navLinks.map((navLink, index) => (
            <li key={index}>
              <a href={navLink.link}>{navLink.text}</a>
            </li>
          ))}
        </ul>
      </section>
    </nav>
  );
};

export default Nav;
